export function sum(a, b) {
    return a + b;
}
export function subtract(a, b) {
    return a - b;
}
export function product(a, b) {
    return a * b;
}
export function divison(a, b) {
    return a / b;
}
export function square(a) {
    return Math.sqrt(a);
}
export function logarithm(a) {
    return Math.log(a);
}
